INSERT INTO `news` VALUES (3,'Ra mắt đường bay thẳng từ Hà Nội đến Tokyo','Chúng tôi vui mừng thông báo khai trương đường bay thẳng mới từ Hà Nội đến Tokyo bắt đầu từ ngày 1/1/2024. Đường bay mới không chỉ rút ngắn thời gian di chuyển mà còn mang đến trải nghiệm bay hiện đại và tiện nghi hơn. Đặc biệt, khách hàng đặt vé sớm sẽ nhận được ưu đãi giảm giá 20% trong tháng đầu tiên. Hãy cùng chúng tôi khám phá Nhật Bản ngay hôm nay!',4,'2024-12-20 15:39:26','2024-12-20 15:39:26'),(4,'Khuyến mãi cuối năm – Bay thoải mái, giá cực thấp','Nhân dịp cuối năm, hãng hàng không của chúng tôi triển khai chương trình giảm giá vé đến 50% cho các chặng bay nội địa và quốc tế. Đây là cơ hội tuyệt vời để bạn cùng gia đình tận hưởng những chuyến du lịch đáng nhớ mà không lo về chi phí. Chương trình áp dụng từ ngày 15/12/2023 đến 31/1/2024. Đừng bỏ lỡ cơ hội săn vé rẻ ngay hôm nay!',4,'2024-12-20 15:39:26','2024-12-20 15:39:26');
/*!40000 ALTER TABLE `news` ENABLE KEYS */;
UNLOCK TABLES;

